import React from 'react';
import { StyleSheet } from 'react';
import './projects.css';

function Projects() {

    state = {
        name: "Title",
        about: "About",
    }

    return (
    <div className="App">

        <div className="mockup">
            <img className="mockupImg"></img>
        </div>

        <div className="mockup">
            <h1>{this.name}</h1>
            <p>{this.about}</p>
        </div>

    </div>
  );
}

export default Projects;
